import image from './hat.jpg'
import womenJacket from './womenJacket.png'

const INITIAL_STATE = {
  womenOptions: [
    {
      title: 'hats',
      imageUrl: image,
      id: 1,
      linkUrl: 'shop/womens/hats'

    },
    {
      title: 'jackets',
      imageUrl: 'https://www.google.com/aclk?sa=l&ai=DChcSEwixlKLWjdfnAhWTxWQKHUjtCd4YABAGGgJwag&sig=AOD64_18RnsT_10BogxCIhsymwF-XpOARg&adurl&ctype=5&ved=2ahUKEwj-r5nWjdfnAhUrIzQIHaBdDfcQvhd6BAgBEFQ',
      id: 2,
      linkUrl: 'shop/jackets'
    },
    {
      title: 'sneakers',
      imageUrl: 'https://i.ibb.co/0jqHpnp/sneakers.png',
      id: 3,
      linkUrl: 'shop/sneakers'
    },
  ]
}

const genderOptionReducer = (state=INITIAL_STATE, action) => {
  switch(action.type) {
    default:
      return state
  }
}

export default genderOptionReducer
